#!/usr/bin/perl

# Test Apple's URLAUTH extension to dovecot.
# Not for distribution outside Apple.

use strict;
use IO::Socket::INET;
use Getopt::Long;
use IPC::Open3;
use Digest::HMAC_MD5;
use APR::Base64;
use feature 'state';

sub usage
{
	die <<EOT;
Usage: $0 --host imap-server --user name --password pw
Options:
	--noburl	test submission BURL
	--mailbox box	append messages to this mailbox
	--quiet
	--warn		warn, not die, on policy violations
	--verbose
EOT
}

my %opts;
GetOptions(\%opts,
    'host=s',
    'mailbox=s',
    'noburl',
    'password=s',
    'quiet',
    'user=s',
    'warn',
    'verbose',
) || usage();

usage() unless $opts{host};
if ($opts{host} !~ /\./) {
	print STDERR "Warning: --host $opts{host} is not fully-qualified and probably won't work.\n";
}
$opts{mailbox} = "INBOX" unless defined($opts{mailbox});
usage() unless $opts{user};
usage() unless $opts{password};

$| = 1;

our $smallbody =<<'EOT';
To: specmail4@gromit.urlauth.test
Subject: foo
Message-Id: <20100203003946.0864F851F6@gromit.urlauth.test>
Date: Tue,  2 Feb 2010 18:39:46 -0600 (CST)
From: root@gromit.urlauth.test (System Administrator)

bar
EOT

our $mediumbody =<<'EOT';
Subject: @1252031830826 APPEND message from SPECimap (init) 
